import React, { useState, useEffect } from 'react';
import axios from 'axios';

const DynamicForm = () => {
  const [countries, setCountries] = useState([]);
  const [cities, setCities] = useState([]);
  const [entrepreneurType, setEntrepreneurType] = useState('');
  const [country, setCountry] = useState('');
  const [city, setCity] = useState('');
  const [formData, setFormData] = useState({
    title: '',
    options: [],
    age: '',
  });

  // Fetch countries on mount
  useEffect(() => {
    axios.get('/api/countries')  // Cambia esto por la URL correcta para obtener los países
      .then(response => setCountries(response.data))
      .catch(error => console.error('Error fetching countries:', error));
  }, []);

  // Fetch cities when country changes
  useEffect(() => {
    if (country) {
      axios.get(`/api/cities?country=${country}`)  // Cambia esto por la URL correcta para obtener las ciudades
        .then(response => setCities(response.data))
        .catch(error => console.error('Error fetching cities:', error));
    }
  }, [country]);

  // Handle form data changes
  const handleFormChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value,
    }));
  };

  // Handle entrepreneur type change
  const handleEntrepreneurTypeChange = (e) => {
    setEntrepreneurType(e.target.value);
    // Reset form data for new entrepreneur type
    setFormData({
      title: '',
      options: [],
      age: '',
    });
  };

  // Handle country change
  const handleCountryChange = (e) => {
    setCountry(e.target.value);
    setCity('');  // Reset city when country changes
  };

  // Handle city change
  const handleCityChange = (e) => {
    setCity(e.target.value);
  };

  return (
    <div>
      <form>
        {/* Country Select */}
        <div>
          <label htmlFor="country">Country:</label>
          <select
            id="country"
            name="country"
            value={country}
            onChange={handleCountryChange}
          >
            <option value="">Select a country</option>
            {countries.map((countryItem) => (
              <option key={countryItem.id} value={countryItem.name}>
                {countryItem.name}
              </option>
            ))}
          </select>
        </div>

        {/* City Select */}
        {country && (
          <div>
            <label htmlFor="city">City:</label>
            <select
              id="city"
              name="city"
              value={city}
              onChange={handleCityChange}
            >
              <option value="">Select a city</option>
              {cities.map((cityItem) => (
                <option key={cityItem.id} value={cityItem.name}>
                  {cityItem.name}
                </option>
              ))}
            </select>
          </div>
        )}
        {/* Entrepreneur Type Select */}
        <div>
          <label htmlFor="entrepreneurType">Entrepreneur Type:</label>
          <select
            id="entrepreneurType"
            name="entrepreneurType"
            value={entrepreneurType}
            onChange={handleEntrepreneurTypeChange}
          >
            <option value="">Select entrepreneur type</option>
            <option value="products">Products</option>
            <option value="services">Services</option>
          </select>
        </div>

        {/* Title and Options based on Entrepreneur Type */}
        {entrepreneurType && (
          <div>
            <label htmlFor="title">Title:</label>
            <input
              type="text"
              id="title"
              name="title"
              value={formData.title}
              onChange={handleFormChange}
            />
          </div>
        )}

        {entrepreneurType === 'products' && (
          <div>
            <label>Product Options:</label>
            <div>
              <label>
                <input
                  type="checkbox"
                  name="options"
                  value="option1"
                  checked={formData.options.includes('option1')}
                  onChange={handleFormChange}
                />
                Product Option 1
              </label>
            </div>
            <div>
              <label>
                <input
                  type="checkbox"
                  name="options"
                  value="option2"
                  checked={formData.options.includes('option2')}
                  onChange={handleFormChange}
                />
                Product Option 2
              </label>
            </div>
          </div>
        )}

        {entrepreneurType === 'services' && (
          <div>
            <label>Service Options:</label>
            <div>
              <label>
                <input
                  type="checkbox"
                  name="options"
                  value="option1"
                  checked={formData.options.includes('option1')}
                  onChange={handleFormChange}
                />
                Service Option 1
              </label>
            </div>
            <div>
              <label>
                <input
                  type="checkbox"
                  name="options"
                  value="option2"
                  checked={formData.options.includes('option2')}
                  onChange={handleFormChange}
                />
                Service Option 2
              </label>
            </div>
          </div>
        )}

        {/* Age Input */}
        <div>
          <label htmlFor="age">Age:</label>
          <input
            type="number"
            id="age"
            name="age"
            value={formData.age}
            onChange={handleFormChange}
            min="18"
            max="100"
          />
        </div>
      </form>
    </div>
  );
};

export default DynamicForm;
